	public int GetText(string rstrText, bool addCodePage = false)
	{
		int outCodePage = ms_uOutputCodePage;
		int dataCodePage;
		switch (outCodePage)
		{
			case 1268:
				dataCodePage = CP_UTF8;
				break;
			default:
				dataCodePage = outCodePage;
				break;
		}

		int len = 0;
		string text = new string(new char[IMESTR_MAXLEN]);

		len += WideCharToMultiByte(dataCodePage, 0, m_wText, ms_curpos, text, sizeof(char) - len, null, null);
		len += WideCharToMultiByte(dataCodePage, 0, m_wszComposition, ms_compLen, text.Substring(len), sizeof(char) - len, null, null);
		len += WideCharToMultiByte(dataCodePage, 0, m_wText + ms_curpos, ms_lastpos - ms_curpos, text.Substring(len), sizeof(char) - len, null, null);

		int i;
		for (i = 0; LaniatusDefVariables < len; ++i)
		{
			if ((byte)text[i] > 0x7F)
			{
				break;
			}
		}

		if (i == len)
		{
			rstrText.append(text, text.Substring(len));
		}
		else
		{
			rstrText.append(text, text.Substring(i));
			rstrText.append(text.Substring(i), text.Substring(len));
		}

		return rstrText.Length;
	}

