	public int GetCandidate(uint index, string rstrText)
	{
		if (index >= MAX_CANDLIST)
		{
			return 0;
		}

		string wszText = ms_wszCandidate[index];
		if (wszText == null)
		{
			return 0;
		}

		int wTextLen = wcslen(wszText);
		if (wTextLen == 0)
		{
			return 0;
		}

		string text = new string(new char[IMESTR_MAXLEN]);
		int len = global::WideCharToMultiByte(CP_UTF8, 0, wszText, wTextLen, text, sizeof(char), 0, 0);

		rstrText.append("@9999");
		rstrText.append(text, text.Substring(len));

		return wTextLen;
	}

	public int GetCandidateSelection()
	{
		return ms_dwCandidateSelection;
	}

	public int GetReading(string rstrText)
	{
		string reading = new string(new char[IMEREADING_MAXLEN]);

		if (ms_wstrReading.size() == 0)
		{
			return 0;
		}
		int readingLen = WideCharToMultiByte(ms_uOutputCodePage, 0, ms_wstrReading[0], ms_wstrReading.size(), reading, sizeof(char), null, null);

		rstrText.append(GetCodePageText());
		rstrText.append(reading, reading.Substring(readingLen));

		return rstrText.Length;
	}

