	public int WMComposition(IntPtr hWnd, uint uiMsg, IntPtr wParam, IntPtr lParam)
	{
		int result = 0;

		if (ms_bCaptureInput == false)
		{
			return 0;
		}

		HIMC hImc = ImmGetContext(hWnd);

		if (hImc == null)
		{
			return 0;
		}

		if (lParam & DefineConstants.GCS_RESULTSTR)
		{
			ResultProcess(hImc);
		}
		if (lParam & DefineConstants.GCS_COMPATTR)
		{
			AttributeProcess(hImc);
		}
		if (lParam & DefineConstants.GCS_COMPSTR)
		{
			if (ms_uOutputCodePage == 950)
			{
				if (lParam & DefineConstants.GCS_COMPATTR)
				{
					CompositionProcessBuilding(hImc);
				}
				else
				{
					CompositionProcess(hImc);
				}
			}
			else
			{
				CompositionProcess(hImc);
			}
		}

		ImmReleaseContext(hWnd, hImc);

		if (ms_pEvent)
		{
			ms_pEvent.OnUpdate();
		}

		return (result);
	}

