	public int WMNotify(IntPtr hWnd, uint uiMsg, IntPtr wParam, IntPtr lParam)
	{
		int result = 0;

		if (ms_bCaptureInput == false)
		{
			return 0;
		}
		switch (wParam)
		{

		case DefineConstants.IMN_OPENCANDIDATE:
		case DefineConstants.IMN_CHANGECANDIDATE:
		{
			if (ms_bUILessMode && !ms_bUseIMMCandidate)
			{
				break;
			}
			HIMC hImc = ImmGetContext(hWnd);
			if (hImc == null)
			{
				break;
			}
			CandidateProcess(hImc);
			if (!m_bUseDefaultIME)
			{
				if (ms_pEvent)
				{
					ms_pEvent.OnOpenCandidateList();
				}
			}
			else
			{
				result = global::DefWindowProc(hWnd, uiMsg, wParam, lParam);
			}
			ImmReleaseContext(hWnd, hImc);
			break;
		}
		case DefineConstants.IMN_CLOSECANDIDATE:
			if (ms_bUILessMode && !ms_bUseIMMCandidate)
			{
				break;
			}
			if (!m_bUseDefaultIME)
			{
				CloseCandidateList();
			}
			else
			{
				result = DefWindowProc(hWnd, uiMsg, wParam, lParam);
			}
			break;

		case DefineConstants.IMN_SETCONVERSIONMODE:
		case DefineConstants.IMN_SETOPENSTATUS:
			if (ms_bUILessMode)
			{
				break;
			}
			CheckToggleState();
			break;

		case DefineConstants.IMN_PRIVATE:
		{
			if (ms_bUILessMode)
			{
				break;
			}
			HIMC hImc = ImmGetContext(hWnd);
			if (hImc == null)
			{
				break;
			}
			ReadingProcess(hImc);

			switch (ms_adwId[0])
			{
				case (MAKELANGID(LANG_CHINESE, SUBLANG_CHINESE_TRADITIONAL) | ((uint)(((byte)(4) << 24) | ((byte)(2) << 16)))):
				case (MAKELANGID(LANG_CHINESE, SUBLANG_CHINESE_TRADITIONAL) | ((uint)(((byte)(4) << 24) | ((byte)(3) << 16)))):
				case (MAKELANGID(LANG_CHINESE, SUBLANG_CHINESE_TRADITIONAL) | ((uint)(((byte)(4) << 24) | ((byte)(4) << 16)))):
				case (MAKELANGID(LANG_CHINESE, SUBLANG_CHINESE_SIMPLIFIED) | ((uint)(((byte)(4) << 24) | ((byte)(1) << 16)))):
				case (MAKELANGID(LANG_CHINESE, SUBLANG_CHINESE_SIMPLIFIED) | ((uint)(((byte)(4) << 24) | ((byte)(2) << 16)))):
					if ((lParam == 1) || (lParam == 2))
					{
						return true ? 1 : 0;
					}
					break;

				case (MAKELANGID(LANG_CHINESE, SUBLANG_CHINESE_TRADITIONAL) | ((uint)(((byte)(5) << 24) | ((byte)(0) << 16)))):
				case (MAKELANGID(LANG_CHINESE, SUBLANG_CHINESE_TRADITIONAL) | ((uint)(((byte)(5) << 24) | ((byte)(1) << 16)))):
				case (MAKELANGID(LANG_CHINESE, SUBLANG_CHINESE_TRADITIONAL) | ((uint)(((byte)(5) << 24) | ((byte)(2) << 16)))):
				case (MAKELANGID(LANG_CHINESE, SUBLANG_CHINESE_TRADITIONAL) | ((uint)(((byte)(6) << 24) | ((byte)(0) << 16)))):
				case (MAKELANGID(LANG_CHINESE, SUBLANG_CHINESE_SIMPLIFIED) | ((uint)(((byte)(5) << 24) | ((byte)(3) << 16)))):
					if ((lParam == 16) || (lParam == 17) || (lParam == 26) || (lParam == 27) || (lParam == 28))
					{
						return true ? 1 : 0;
					}
					break;
			}
			ImmReleaseContext(hWnd, hImc);
			break;
		}
		}

		if (ms_pEvent)
		{
			ms_pEvent.OnUpdate();
		}

		return result;
	}

	public int WMChar(IntPtr hWnd, uint uiMsg, IntPtr wParam, IntPtr lParam)
	{
		byte c = wParam & 0xff;

		switch (c)
		{
		case 8:
			if (ms_bCaptureInput == false)
			{
				return 0;
			}
			if (ms_curpos > 0)
			{
				DecCurPos();
				DelCurPos();
			}
			if (ms_pEvent)
			{
				ms_pEvent.OnUpdate();
			}
			return 0;
			break;

		default:
			if (ms_pEvent)
			{
				if (ms_pEvent.OnWM_CHAR(wParam, lParam))
				{
					break;
				}
			}
			if (ms_bCaptureInput == false)
			{
				return 0;
			}
			string w = new string(new char[10]);
			MultiByteToWideChar(ms_uInputCodePage, 0, (string) & c, 1, w, 1);

			OnChar(w[0]);
			if (w[0] == '|')
			{
				OnChar(w[0]);
			}
			if (ms_pEvent)
			{
				ms_pEvent.OnUpdate();
			}
			break;
		}

		return 0;
	}

	protected void IncCurPos()
	{
		if (ms_curpos < ms_lastpos)
		{
			int pos = FindColorTagEndPosition(m_wText + ms_curpos, ms_lastpos - ms_curpos);

			if (pos > 0)
			{
				ms_curpos = Math.Min(ms_lastpos, Math.Max(0, ms_curpos + (pos + 1)));
			}
			else
			{
				++ms_curpos;
			}
		}
	}

	protected void DecCurPos()
	{
		if (ms_curpos > 0)
		{
			int pos = FindColorTagStartPosition(m_wText + ms_curpos - 1, ms_curpos);

			if (pos > 0)
			{
				ms_curpos = Math.Min(ms_lastpos, Math.Max(0, ms_curpos - (pos + 1)));
			}
			else
			{
				--ms_curpos;
			}
		}
	}

	protected void SetCurPos(int offset)
	{
		if (offset < 0 || offset > ms_lastpos)
		{
			ms_curpos = ms_lastpos;
			return;
		}
		else
		{
			ms_curpos = Math.Min(ms_lastpos, GetTextTagInternalPosFromRenderPos(m_wText, ms_lastpos, offset));
		}
	}

	protected void DelCurPos()
	{
		if (ms_curpos < ms_lastpos)
		{
			int eraseCount = FindColorTagEndPosition(m_wText + ms_curpos, ms_lastpos - ms_curpos) + 1;
			wcscpy(m_wText + ms_curpos, m_wText + ms_curpos + eraseCount);
			ms_lastpos -= eraseCount;
			ms_curpos = Math.Min(ms_lastpos, ms_curpos);
		}
	}

