	protected uint GetCodePageFromLang(int langid)
	{
		uint pri_langid = PRIMARYLANGID(langid);
		switch (pri_langid)
		{
			case LANG_JAPANESE:
				return 932;
			case LANG_KOREAN:
				return 949;
			case LANG_CHINESE:
			{
					switch (SUBLANGID(langid))
					{
						case SUBLANG_CHINESE_SIMPLIFIED:
						case SUBLANG_CHINESE_SINGAPORE:
							return 936;
						case SUBLANG_CHINESE_TRADITIONAL:
						case SUBLANG_CHINESE_MACAU:
						case SUBLANG_CHINESE_HONGKONG:
							return 950;
					}
			}
				return 936;
			case LANG_ARABIC:
				return 1256;
			case LANG_GREEK:
				return 1253;
			case LANG_TURKISH:
				return 1254;
			case LANG_HEBREW:
				return 1255;
			case LANG_ESTONIAN:
			case LANG_LATVIAN:
			case LANG_LITHUANIAN:
				return 1257;
			case LANG_VIETNAMESE:
				return 1258;
			case LANG_THAI:
				return 874;
			case LANG_CZECH:
			case LANG_HUNGARIAN:
			case LANG_POLISH:
			case LANG_CROATIAN:
			case LANG_MACEDONIAN:
			case LANG_ROMANIAN:
			case LANG_SLOVAK:
			case LANG_SLOVENIAN:
