	protected bool IsMax(string wInput, int len)
	{
		if (ms_lastpos + len > IMESTR_MAXLEN)
		{
			return true;
		}

		int textLen = WideCharToMultiByte(ms_uOutputCodePage, 0, m_wText, ms_lastpos, 0, 0, null, null);
		int inputLen = WideCharToMultiByte(ms_uOutputCodePage, 0, wInput, len, 0, 0, null, null);

		if (textLen + inputLen > m_max)
		{
			return true;
		}
		else if (m_userMax != 0 && m_max != m_userMax)
		{
			string str = GetTextTagOutputString(m_wText, ms_lastpos);
			string input = GetTextTagOutputString(wInput, len);
			int textLen = WideCharToMultiByte(ms_uOutputCodePage, 0, str, str.Length, 0, 0, null, null);
			int inputLen = WideCharToMultiByte(ms_uOutputCodePage, 0, input, input.Length, 0, 0, null, null);
			return textLen + inputLen > m_userMax;
		}
		return false;
	}

