	public static bool CurrentInputLocaleIsIme()
	{
		bool ret = false;
		int hr;

		@interface ITfInputProcessorProfiles * pProfiles;
		hr = CoCreateInstance(CLSID_TF_InputProcessorProfiles, null, CLSCTX_INPROC_SERVER, __uuidof(@interface ITfInputProcessorProfiles), (object) & pProfiles);
		if ((((int)(hr)) >= 0))
		{
			@interface ITfInputProcessorProfileMgr * pProfileMgr;
			hr = pProfiles.QueryInterface(__uuidof(@interface ITfInputProcessorProfileMgr), (object) & pProfileMgr);
			if ((((int)(hr)) >= 0))
			{
				TF_INPUTPROCESSORPROFILE tip = new TF_INPUTPROCESSORPROFILE();
				hr = pProfileMgr.GetActiveProfile(GUID_TFCAT_TIP_KEYBOARD, tip);
				if ((((int)(hr)) >= 0))
				{
					ret = (tip.dwProfileType & DefineConstants.TF_PROFILETYPE_INPUTPROCESSOR) != 0;
				}
				pProfileMgr.Release();
			}
			pProfiles.Release();
		}
		return ret;
	}

	public static void UpdateImeState(bool bResetCompartmentEventSink = false)
	{
		@interface ITfCompartmentMgr * pcm;
		@interface ITfCompartment * pTfOpenMode = null;
		@interface ITfCompartment * pTfConvMode = null;
		if (GetCompartments(pcm, pTfOpenMode, pTfConvMode))
		{
			VARIANT valOpenMode = new VARIANT();
			VARIANT valConvMode = new VARIANT();
			pTfOpenMode.GetValue(valOpenMode);
			pTfConvMode.GetValue(valConvMode);
			if (valOpenMode.vt == VT_I4)
			{
				if (CIME.ms_bChineseIME)
				{
					CIME.ms_dwImeState = valOpenMode.lVal != 0 && valConvMode.lVal != 0 ? IMEUI_STATE_ON : IMEUI_STATE_ENGLISH;
				}
				else
				{
					CIME.ms_dwImeState = valOpenMode.lVal != 0 ? IMEUI_STATE_ON : IMEUI_STATE_OFF;
				}
			}
			VariantClear(valOpenMode);
			VariantClear(valConvMode);

			if (bResetCompartmentEventSink)
			{
				SetupCompartmentSinks(false, pTfOpenMode, pTfConvMode);
			}
			pTfOpenMode.Release();
			pTfConvMode.Release();
			pcm.Release();
		}
	}

	public static void EnableUiUpdates(bool bEnable)
	{
		if (m_tm == null || (bEnable && m_dwUIElementSinkCookie != (0xffffffff)) || (!bEnable && m_dwUIElementSinkCookie == (0xffffffff)))
		{
			return;
		}
		@interface ITfSource * srcTm = null;
		int hr = E_FAIL;
		if ((((int)(hr = m_tm.QueryInterface(__uuidof(@interface ITfSource), (object) & srcTm))) >= 0))
		{
			if (bEnable)
			{
				hr = srcTm.AdviseSink(__uuidof(@interface ITfUIElementSink), (@interface ITfUIElementSink)m_TsfSink, m_dwUIElementSinkCookie);
			}
			else
			{
				hr = srcTm.UnadviseSink(m_dwUIElementSinkCookie);
				m_dwUIElementSinkCookie = (0xffffffff);
			}
			srcTm.Release();
		}
